import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';

import reportWebVitals from './reportWebVitals';
import { Provider } from 'react-redux';
import store from './redux/Store/index';
import { login, userProfile } from './redux/actions/all.actions'; // Importez l'action login

// Déclenchez l'action login au démarrage de l'application
const token = localStorage.getItem('token');
if (token) {
  store.dispatch(login()); // Appel de l'action login sans les paramètres email et password
}

// Lancez également l'action userProfile si nécessaire
store.dispatch(userProfile());

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Provider store={store}>
      <App />
    </Provider>
  </React.StrictMode>
);

// Mesurez les performances de votre application
reportWebVitals();
